import React, { useState } from 'react';
import ArrowSvg from '../components/icons/ArrowSvg';

import SearchLayout from '../components/layouts/searchLayout';
import AllTrending from '../dashboard/featured/Trending';
import TrendingMovie from '../dashboard/featured/TrendingMovies';
import TrendingTv from '../dashboard/featured/TrendingTv';
import LatestMovieTv from '../dashboard/LatestMovie';
import SearchMovieQuery from '../hooks/searchMovie';
import FetchTrendsQuery from '../hooks/getAllTrends';
import { Link } from 'react-router-dom';

interface DisplayProps {
  searchQuery: string;
}

export default function Display({ searchQuery }: DisplayProps) {
  const buttonStyle = 'rounded bg-[#1a212d] ml-2 my-2 px-2 text-center text-[#605f62] h-[30px] font-light text-[12px]';
  const buttonStyle1 = 'rounded bg-[#ffae06] text-white ml-2 my-2 px-2 text-center h-[30px] font-light text-[12px]';

  const [activeButton, setActiveButton] = useState('trending');

  const handButton = (buttonName: string) => {
    setActiveButton(buttonName);
  };

  const { isLoading, isError: FetchTrendingError, isSuccess, data: Movies } = SearchMovieQuery(searchQuery);
  const {data: movies} = FetchTrendsQuery()

  return (
    <div>
      {!searchQuery ? (
        <div className="bg-[#020916] pt-10">
          <div className="flex">
            <p className="my-2 ml-2 text-white font-extrabold text-[24px]">FEATURED</p>
            <button onClick={() => handButton('movie')} className={activeButton === 'movie' ? buttonStyle1 : buttonStyle}>
              Movies
            </button>
            <button onClick={() => handButton('tv')} className={activeButton === 'tv' ? buttonStyle1 : buttonStyle}>
              TV shows
            </button>
            <button onClick={() => handButton('trending')} className={activeButton === 'trending' ? buttonStyle1 : buttonStyle}>
              Trending
            </button>
          </div>

          {/* Section for the images and the update content */}
          <div className="flex flex-wrap">
            <div className="w-3/4">
              {activeButton === 'trending' ? <AllTrending /> : activeButton === 'movie' ? <TrendingMovie /> : activeButton === 'tv' ? <TrendingTv /> : ''}
              <LatestMovieTv />
            </div>

            <div className="w-1/4 ">
              <div className="h-full">
                {/* Place your text content here */}
                <div className="flex pt-[210px] pl-[5px] font-extrabold">
                  <p className="pl-4 text-white font-extrabold text-[24px]">UPDATED</p>
                  <div className=" ml-10 text-center pl-[70px]">
                    <button className=" w-[70px] text-center text-[#605f62] h-[30px] bg-[#1a212d] rounded-md flex pl-[9px] font-medium text-[12px] pt-[5px]">
                      More
                      <span>
                        <svg xmlns="http://www.w3.org/2000/svg" height="28" viewBox="0 -960 960 960" width="28" className="pb-2 text-base font-semibold">
                          <path d="m375-240-43-43 198-198-198-198 43-43 241 241-241 241Z" />
                        </svg>
                      </span>
                      <span className="bg-red-400"></span>
                    </button>
                  </div>
                </div>

                {/* The code on the update part */}
                <div className="pl-[5px] pt-[65px] ">
                  {movies && movies.slice(0, 9).map((movie: any) => (
                    <div className={`flex-col w-[280px] h-[70px] mt-[2px] bg-[#020916] text-white  border-2 border-zinc-700 border-solid rounded-md ${movie[0] ? 'mt-[30' : ''}`}>
                      <div className="flex hover:bg-radientColor">
                        <Link to={`/movie/${movie.id}`}>
                          <img src={`https://image.tmdb.org/t/p/w500/${movie.poster_path}`} alt="" className="w-10 h-[60px] md:32 pl-2 pt-2 rounded-md text-center" />
                          <p className="pt-2 pl-2 truncate">{movie.title || movie.name}</p>
                        </Link>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>
      ) : (
        <SearchLayout handleSearch={() => {}} searchQuery={searchQuery} />
      )}
    </div>
  );
}
